import React from "react"
import CreateCard from "./CreateCard"

function Gallery(props) {
    return (
        <div>
            {props.wallet.map((e, id) => 
                <CreateCard
                    asset={e["asset"]}
                    quantity={e["quantity"]}
                    src={e["src"]}
                    key={id}
                />
            )}
        </div>
    )
}

export default Gallery
